vector<string> genRotations(const string& s) {
    vector<string> result;
    for (int i = 1; i < s.size(); i++) {
        result.push_back(s.substr(i) + s.substr(0, i));
    }
    return result;
}

int sumOfRotations(const string& s) {
    int result = 0;
    for (const string& r : genRotations(s)) {
        result += stoi(r);
    }
    return result;
}
